/**
 * @file Created on 2019-4-10 轻浏览框架设置顶bar,右侧功能区菜单点击
 * @module ui/setActionBarRightMenu
 * @author sunxiaoyu01 <sunxiaoyu01@baidu.com>
 */

import register from '../register';
import {getParams} from '../utils';
import {open} from './index';

register('easybrowse/openSetActionBarRightMenu', {
    v: 45,
    androidVersionRange: ['11.7.1'],
    filter() {
        return {
            module: 'easybrowse',
            action: 'setActionBarRightMenu'
        };
    }
});
/**
 * @function openSetActionBarRightMenu
 * @param {Object} [params={}] - 参数
 */
export default (params = {}) => open(getParams('easybrowse-setActionBarRightMenu', params));